// src/pages/EventDetails.js
import React from 'react';
import { useParams } from 'react-router-dom';

const EventDetails = () => {
    const { id } = useParams();
    const event = {}; // Fetch event details by ID

    return (
        <div>
            <h2>{event.title}</h2>
            <p>{event.date}</p>
            <p>{event.location}</p>
            <p>{event.description}</p>
            <button>Buy Tickets</button>
        </div>
    );
}

export default EventDetails;
